description:
3D in Photoshop: The Ultimate Guide for Creative Professionals 

This is the first book of its kind that shows you everything you need to know to create or integrate 3D into your designs using Photoshop CS5 Extended. If you are completely new to 3D, you'll find the great tips and tricks in 3D in Photoshop invaluable as you get started. There is also a wealth of detailed technical insight for those who want more. Written by the true experts - Adobe's own 3D team - and with contributions from some of the best and brightest digital artists working today, this reference guide will help you to create a comprehensive workflow that suits your specific needs. Along the way, you'll pick up troubleshooting tips and advice from the industry experts and you'll be inspired by many examples of full colour, original works of 3D art. 

